import React from 'react';

const Friend = props => {
  return (
    <div className="friendWrapp" key={props.id}>
      <h2 className="name">{props.name}</h2>
      <div className="age">{props.age}</div>
      <div className="email">{props.email}</div>
    </div>
  );
};

export default Friend;
